import React from 'react';
import { Col, Container, Image } from 'react-bootstrap';
function Welcome() {
    return (
        <Container>
            <Col xs={6} md={4}>
                <Image src="holder.js/171x180" rounded />
            </Col>
        </Container>
    )
}
export default Welcome
